  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lostwood Migratory
  Waterfowl Refuge outlines Refuge accomplishments from August through October of
  1941. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds and upland game birds- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing. Photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
